import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";

function MyApp() {
  <ul>
    <li>Hello</li>
    <li>World</li>
    <li>Yo</li>
  </ul>;
}
ReactDOM.render(<MyApp />, document.getElementById("root"));

serviceWorker.unregister();
